				$J('.bottom_links').css({display:'none'});
				//try display none element before content
				if (typeof window.top === 'undefined') console.log('!window.top undefined!');
				// didi : desactivate , don't work , i can't access parent window of the iframe
				//$J('#content').parent().children().each(function(){
    		//	if ( $J(this).attr("id") === undefined || $J(this).attr("id") != 'content') {
