		+'		</center>'
		+'	</div>'
		+'  <div>'
		+'  <center>'
		+'	<table id=' + setUID('Tabs.Waves.tabTargets.units') + ' class=' + UID['table'] + '>'
		+'		<tr>'
		+'			<th colspan=8><h4>' + translate('Troops for Wave Attack') + '</h4></th>'
		+'		</tr>'
		+'	</table>'
		+'  </center>'
		+'	</div>'
