		+'  <center>'
		+'	<table id=' + setUID('Tabs.Waves.tabTargets.dragons') + ' class=' + UID['table'] + '>'
		+'		<tr>'
		+'			<th colspan=8><h4>' + translate('Send Dragon every certain number of waves') + '</h4></th>'
		+'		</tr>'
