				if (evol < 0) {
					evol = parseInt(evol).intToCommas();
					fontC_evol='red';
				}
				else if (evol > 0) {
					evol = '+'+parseInt(evol).intToCommas();
					fontC_evol='green';
				}
				else evol = parseInt(evol).intToCommas();
